alias Sqaure_AutoShoot_Enable "exec Sqaure/src/main/cfg/cn/luotiany1/SqaureNextgen/Features/Modules/Combat/Autoshoot/AutoshootEnable"
alias Sqaure_AutoShoot_Disable "exec Sqaure/src/main/cfg/cn/luotiany1/SqaureNextgen/Features/Modules/Combat/Autoshoot/AutoshootDisable"
alias Sqaure_AutoShoot_Manager "Sqaure_AutoShoot_Manager_1"
alias Sqaure_AutoShoot_Manager_1 "Sqaure_AutoShoot_Enable;alias Sqaure_AutoShoot_Manager Sqaure_AutoShoot_Manager_0;Sqaure_AutoShoot_Output_1"
alias Sqaure_AutoShoot_Manager_0 "Sqaure_AutoShoot_Disable;alias Sqaure_AutoShoot_Manager Sqaure_AutoShoot_Manager_1;Sqaure_AutoShoot_Output_0"
alias Sqaure_Output_Team "alias Sqaure_AutoShoot_Output_1 Sqaure_AutoShoot_Output_Team_1;alias Sqaure_AutoShoot_Output_0 Sqaure_AutoShoot_Output_Team_0"
alias Sqaure_Output_Echo "alias Sqaure_AutoShoot_Output_1 Sqaure_AutoShoot_Output_Echo_1;alias Sqaure_AutoShoot_Output_0 Sqaure_AutoShoot_Output_Echo_0"
alias Sqaure_Output_Null "alias Sqaure_AutoShoot_Output_1;alias Sqaure_AutoShoot_Output_0;"
alias Sqaure_AutoShoot_Output_Team_1 "say_team [Sqaure]自动手枪已开启"
alias Sqaure_AutoShoot_Output_Team_0 "say_team [Sqaure]自动手枪已关闭"
alias Sqaure_AutoShoot_Output_Echo_1 "echo [Sqaure]自动手枪已开启"
alias Sqaure_AutoShoot_Output_Echo_0 "echo [Sqaure]自动手枪已关闭"

